import { FETCH_DATAS } from '../Actions/types';
import _ from 'lodash';


export default (state= [], action) => {
    switch (action.type) {
        case FETCH_DATAS: 
        return { ...state, ..._.mapKeys(action.payload, 'id')};

        default: 
        return state;
    }
}
